import ItemForm from "./ItemForm";
import './NewItemAdded.css';

const NewItemAdded =()=> {

    const SaveDataHandler =(InputNewData)=> {
        AddData = {
            ...NewData ,
            id : Math.random().toString()
        };
    }

    return (
        <div className="newItem" OnSaveData={SaveDataHandler}>
            <ItemForm/>
        </div>
    )
}

export default NewItemAdded;
